import React from "react";
import TitleLogo from "../logo192.png";
import PatientLogo from "../logo192.png";
import { Link } from "react-router-dom";
import { verify_jwt } from "../apicalls/axiosInstance.js";
import { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

function LandingPage() {
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('JWT');

    if (token) {
      console.log("Found a JWT token");
      const response = verify_jwt(token);

      if (response != "1" && response != "2") {
        navigate("/Home");
      }
    }
  }, []);

  return (
<div className="container d-flex flex-column align-items-center justify-content-center" style={{ height: "100vh" }}>
  <img src={TitleLogo} className="img-fluid mb-4" alt="Clik Care Logo" />
  <h2 className="mb-4">Login as</h2>
  <div className="row">
    <div className="col text-center">
      <Link to="/patientLogin">
        <button className="btn btn-link" style={{ padding: "0", borderWidth: "0", background: "none" }}>
          <img src={PatientLogo} className="img-fluid" alt="Patient Logo" />
        </button>
      </Link>
      <p className="card-text mt-2">User</p>
    </div>
    <div className="col text-center">
      <Link to="/doctorLogin">
        <button className="btn btn-link" style={{ padding: "0", borderWidth: "0", background: "none" }}>
          <img src={DoctorLogo} className="img-fluid" alt="Doctor Logo" />
        </button>
      </Link>
      <p className="card-text mt-2">Admin</p>
    </div>
  </div>
  <p className="card-text mt-5 text-center">
    Don't have an account?{" "}
  </p>
  <div className="d-flex justify-content-center">
    <Link to="/patientRegister" className="card-link me-3">
      Register as User
    </Link>
    <Link to="/doctorRegister" className="card-link">
      Register as Admin
    </Link>
  </div>
</div>

  );
}

export default LandingPage;
